import { useLoaderData } from "react-router-dom";
import { Link } from "react-router-dom";

function EventPage() {
  const data = useLoaderData();
  const events = data.events; 

  return (
    <>
      <h1>Event Page</h1>
      <ul>
        {events.length > 0 ? (
          events.map((event) => (
            <li key={event.id}>
              <Link to={event.id}>{event.title}{event.im}</Link>
            </li>
          ))
        ) : (
          <p>No events found.</p>
        )}
      </ul>
    </>
  );
}

export default EventPage;
